import React, { Component } from 'react'

export default class favbeaches extends Component {

    render() {
        let beBeachUrl = "http://localhost:3000/favbeaches"
       const beach = fetch(beBeachUrl)
        .then(res => res.json())
        .then((resArray)=>{resArray.map(
            (beachObj)=>{
        return (
            <div>
                <img src={beachObj}>Beach Photo</img>
            </div>
                )    
            })    
        }
        )
    }
}
